import React from 'react';
import './services.css';
import { RiPencilRuler2Line } from 'react-icons/ri';


class Question extends React.Component {
    render() {
      return <h3> Lets go for a <RiPencilRuler2Line />? </h3>
    }
  }
const Services = () => {
    return(
        <div className='malithebrand__product-offerings'>

        <div className='malithebrand__product-offerings_brand-identity'>
        <div className='malithebrand__product-offerings_brand-identity-card'>
            <img src={ RiPencilRuler2Line } alt="pencil" />
        </div>
        <p>Brand Identity Design</p>
        </div>


        <div className='malithebrand__product-offerings_ui-ux'>
        <div className='malithebrand__product-offerings_ui-ux-card'></div>
        <p>UI/UX Design</p>
        </div>


        <div className='malithebrand__product-offerings_web-dev'>
        <div className='malithebrand__product-offerings_web-dev-card'></div>
        <p>Web Development</p>
        </div>

    </div>
    )
}
export default Services
